import React from 'react'
import './NavBarMobile.scss'

export default function NavBarMobile({checked,list}) {
	var classes=['NavBarMobile',checked?'opacity':'']
	console.log(classes)
	return (
		<div style={{opacity:checked?'1':'0'}} className={classes[0] +''+ classes[1]}>
			{list}
		</div>
	)
}
